import './App.css';

function App() {

  const listArray = ["jajko", "cebulka", "herbata", "kawusia"]

  const list = listArray.map(( list => 
    <input
      type="checkbox"
      name="main"
      value={list}
    />))

  return (
    <div>
      {list}
    </div>
  );
}

export default App;
